import React from "react";
import { View, Image, StyleSheet, List } from "react-native";
import movies from "../assets/data/videos";

const clips = movies.movies[0];

const Carousel = () => {
  return (
    // <View style={styles.container}>
    <View style={styles.carousel}>
      <Image
        style={styles.redline}
        source={require("../assets/redline-horizontal.png")}
      />
      <List
        data={clips}
        renderItem={({ item }) => (
          <Image source={require("../assets/clip.png")} style={styles.clip} />
        )}
      />

      <Image
        style={styles.redline}
        source={require("../assets/redline-horizontal.png")}
      />
    </View>
    // </View>
  );
};

const styles = StyleSheet.create({
  container: {
    // flex: 1,
    width: "100%",
    justifyContent: "center",
    // resizeMode: "contain",
    flexDirection: "row",
  },
  carousel: {
    width: "80%",
    justifyContent: "center",
    resizeMode: "contain",
  },

  clip: {
    marginTop: 10,
    resizeMode: "contain",
    // width: "100%",
    // height: "auto",
  },

  redline: {
    // flex: 1,
    width: "100%",
  },
});

export default Carousel;
